import React, { Component } from "react";
import { connect } from "react-redux";
import { withRouter } from "react-router-dom";
import { compose } from "redux";
import mapDispatchToProps from "../../redux/DispatchToProps";
import mapStateToProps from "../../redux/StateToProps";

class EditContent extends Component {
  onSubmit(e) {
    document.getElementById("textcontent")
    this.props.history.push("/home");
  }

  render() {
    var namelist = ["ALL", "House", "Game", "Pet", "Other"];
    return (
      <div>
        <div>
          <p>List EditContent</p>
          <ul>
            {namelist.map((value, index) => {
              return (
                <div>
                  <div class="btn-check" id={index + value} />
                  <label class="btn btn-outline-primary" for={index + value}>
                    {value}
                  </label>
                </div>
              );
            })}
            <textarea id="textcontent"></textarea>
            <input
              type="button"
              value="submit"
              onClick={this.onSubmit.bind(this)}
            />
          </ul>
        </div>
      </div>
    );
  }
}

export default compose(
  withRouter,
  connect(mapStateToProps, mapDispatchToProps)
)(EditContent);
